script: |
  super -f text -I q10112.spq | sort > q10112.out

inputs:
  - name: q10112.spq
    data: |
      SELECT DISTINCT col1 * - 2 + - - col2 + - col0 + - col1 FROM tab0 (FORMAT parquet) WHERE NOT + + col1 BETWEEN + col1 + col1 * - 29 - - + 64 AND col2;
  - name: tab0

outputs:
  - name: q10112.out
    data: |
      -1
      -140
      -211
